controller.down.onEvent(ControllerButtonEvent.Pressed, function () {
    player1.y += 35
})
sprites.onOverlap(SpriteKind.Enemy, SpriteKind.collectible, function (sprite, otherSprite) {
    positioning(160, collect)
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Enemy, function (sprite, otherSprite) {
    /*************************\
     ***ADD YOUR CODE BELOW***
    \*************************/
    sprite.setPosition(40, 40)

    /*************************\
     ***ADD YOUR CODE ABOVE***
    \*************************/
    info.changeLifeBy(-1)
    music.pewPew.play()
    scene.cameraShake(4, 500)
    info.changeScoreBy(-3)
    if (info.score() < 0) {
        info.setScore(0)
    }
    positioning(160, myEnemy)
})

function positioning (num: number, mySprite: Sprite) {
    position = Math.randomRange(0, 3)
    if (position == 0) {
        mySprite.setPosition(num, 15)
    }
    if (position == 1) {
        mySprite.setPosition(num, 44)
    }
    if (position == 2) {
        mySprite.setPosition(num, 78)
    }
    if (position == 3) {
        mySprite.setPosition(num, 111)
    }
}

sprites.onOverlap(SpriteKind.Player, SpriteKind.collectible, function (sprite, otherSprite) {
    info.changeScoreBy(1)
    music.baDing.play()
    positioning(160, collect)
})
controller.up.onEvent(ControllerButtonEvent.Pressed, function () {
    player1.y += -35
})
